promotional_text:
meet our new head of funcyling, @ryans_recycling ♻️ he's got 3 fun ideas for what to use to carry your comic books, baseball mitts & groceries...because it shouldn't be a plastic bag! 

@oldnavy is eliminating plastic shopping bags in our u.s & canada stores by 2023 🎉 so that together, we can imagine a greener future where plastic waste is a thing of the past 💨

#imagineabetterfuture☁️

